import React from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from '@mui/material';

const TrackingStatus = () => {
  // Названия столбцов таблицы
  const columns = [
    "Номер заказа",
    "Дата создания",
    "Статус",
    "Сумма документа",
    "Номер телефона",
    "Полное имя",
    "Себестоимость"
  ];

  return (
    <TableContainer component={Paper} style={{ marginTop: '20px', marginBottom: '20px' }}>
      <Table>
        <TableHead>
          <TableRow>
            {columns.map((column, index) => (
              <TableCell key={index}>{column}</TableCell>
            ))}
          </TableRow>
        </TableHead>
        <TableBody>
          {/* Здесь будет код для отображения строк таблицы, которые вы можете добавить динамически */}
          <TableRow>
            {/* Пример строки с данными */}
            <TableCell>1</TableCell>
            <TableCell>01.01.2024</TableCell>
            <TableCell>Обработан</TableCell>
            <TableCell>$100.00</TableCell>
            <TableCell>+380123456789</TableCell>
            <TableCell>Иван Иванов</TableCell>
            <TableCell>$50.00</TableCell>
          </TableRow>
        </TableBody>
      </Table>
    </TableContainer>
  );
};

export default TrackingStatus;
